import React from "react";
import {PasswordGenerated} from "../passwordGenerated/PasswordGenerated";
import {useState} from "react";

export function ConptrolPanel(){
    let [value, setValue] = useState();
    return(
        <PasswordGenerated >

            <div className='variableButtons'>
                <button className='strongPassword'>Strong Password</button>
                <button className='pin'>Pin</button>
                <button className='update'>Update</button>
                <button className='Buffer'>Copy Password</button>
            </div>
            <div className='controlButtons'>
                <label htmlFor="myRange">Length </label>
                <input onChange={(e) => setValue(e.target.value)} type="range" min='8' max='100' value={value} id='myRange'/>
                <label htmlFor="myRange">{value}</label>
                <input type="checkBox" id='numbers'/>
                <label htmlFor="numbers">Numbers</label>
                <input type="checkBox" id='signs'/>
                <label htmlFor="signs">Signs</label>
            </div>

        </PasswordGenerated>
    );

}
